const NotFound = () => {
    return(
        <>
             <Hero text="404 Error" />
            {/* <h1 className="error-heading">404 Error</h1> */}
            <h1 className="error-heading">Page Not Found</h1>
            <p className="error-txt">This was a web page for an organization that used to exist. This organization no longer exists as it has been replaced with a new organization to teach surf kids the values and love of the ocean. The new site is: https://www.pleasurepointsurfclub.com/
            <br /><br /> 
                If you came upon this page by mistake, try checking the URL in your web browser.</p>
        </>

    );

}

export default NotFound
